  false,\n\t\"url\": null,\n\t\"notes\": \"This set of hydrographic casts are from
  the Columbia River Plume Study (1990-1991). The project included CTD temperature,
  salinity pressure, conductivity observations and dynamic height. The purpose of
  this data set was to map the extent and thickness of the Columbia River plume off
  the states of Washington and Oregon during the fall season in conjunction with the
  deployment of moorings and drifters.\",\n\t\"license_title\": null,\n\t\"extras\":
